                        new { Id = 1, Info = "Liverpul futbol klubu 'Everton' və klub prezidenti, həmçinin Enfild stadionunda pay sahibi olan Con Houldinq arasında yaranmış münaqişə sonrası yaradılmışdır. Stadionda keçirdiyi 8 ildən sonra 1892-ci ildə 'Everton' Qudison Park stadionuna köçdü və Houldinq Liverpul adlı klubun əsasını qoydu. Beləliklə klub ev oyunlarını Enfild stadionunda keçirməyə başladı. Əsl adı Everton və Atletik Qraunds Ltd (qısaca Everton Atletik) olan klubu futbol assosiasiya Everton adlı klub kimi qəbul etməkdən imtina etməsindən sonra klub adını dəyişərək Liverpul etdi və 1892-ci ilin martında yaradılmasından 3 ay sonra futbol assosiasiyası tərəfindən rəsmi olaraq tanındı. Debüt mövsümündə klub Lankaşayr liqasını qazandı və 1893-94 mövsümündə ikinci divizyonda iştirak üçün vəsiqə qazandı. Klub mövsümü birinci pillədə tamamladıqdan sonra birinci divizyona yüksəldi ki, burada 1901 və 1906-cı ildə turniri birinci pillədə başa vurmağa müvəffəq oldu.Liverpu ilk dəfə İngiltərə Federasiya Kubokunun finalına 1914-cü ildə çıxmışdır ki, burada da onlar 'Börnli' klubuna 0-1 hesabı ilə məğlub olmuşdur. Ardıcıl olaraq isə klub 1922 və 1923-cü illərdə İngiltərə liqa çempionluğunu qazansada, 1946-47 mövsümünədək heç bir mükafat qazana bilməmişdir. Liverpul 1950-ci ildə ikinci dəfə çıxdığı İngiltərə Federasiya Kubokunun finalında bu dəfə 'Arsenal' 2-0 hesabı ilə məğlub oldu. Klub 1953–54 mövsümündə ikinci divizyona yuvarlandı. 1958-59 mövsümünün kubok matçında isə bu dəfə 'Uorçester' klubuna məğlub olduqdan sonra klubun məşqçi postunda dəyişiklik edilərək bu vəzifəyə Uilyam Bil Şenkli gətirildi. Kluba yeni gələn Uilyam Bil Şenkli dərhal 24 oyunçu ilə yollarını ayırdı və Enfilddə yerləşən ayaqqabı otağını dəyişərək buranı məşqçilik üçün işini görə biləcəyi bir otağa çevirdi. Şenkli və digərləri Co Faqan, Ruben Bennet və Bob Peysli klubda yenidən dəyişikliklər aparmağa başladılar.Klub 1962-ci iidə yenidən birinci divizyona geri qayıtdı və 17 ildən sonra 1964-cü ildə burada qalib oldu. 1965-ci ildə klub tarixində ilk dəfə İngiltərə Federasiya Kubokunu qazandı. Liverpul final görüşündə 'Lids' klubuna 2-1 hesabı ilə qalib gəlməklə kuboku başı üzərinə qaldırdı. Növbəti il, 1966-cı ildə klub birinci divizyonun qalibi oldu amma buna baxmayaraq UEFA Kuboklar Kuboku turnirinin finalında Almaniyanın 'Borussiya Dortmund' komandasına 2-1 hesabı ilə məğlub oldu. Finalda Liverpulun yeganə qoluna Rocer Hant imza atmışdır. Liverpul 1972-73 mövsümündə ölkə çempionluğunu, İngiltərə Federasiya Kubokunu qazanmaqla bərabər həmçinin UEFA Kubokunuda qazanmağı bacardı. UEFA Avropa Liqasının finalında onlar Almaniyanın 'Borussiya Münhenqladbax' klubuna iki oyunun yekun nəticəsində 3-2 hesabı ilə qalib gəldilər. Sonradan tezliklə Uilyam Bil Şenkli təqaüdə çıxdı və onu postunda Bob Peysli əvəz etdi. 1976-cı ildə Peyslinin ikinci məşqçilik dövründə Liverpul yenidən İngiltərə çempionluğunu və UEFA Kubokunu qazandı. UEFA Kubokunun finalında onlar Belçikanın 'Brügge' klubuna iki oyunun yekun nəticəsində 4-3 hesabı ilə qalib gəldilər. Növbəti mövsüm klub İngiltərə çempionluğunu qorudu və əlavə olaraq tarixində ilk dəfə UEFA Çempionlar Liqası turnirini qazandı. Finalda onlar 'Borussiya Münhenqladbax' klubuna 3-1 hesabı ilə qalib gəldilər. Amma İngiltərə Federasiya Kubokunun finalında onlar məğlub oldular. Liverpul 1978-ci ildə sahib olduğu UEFA Çempionlar Liqası titulunu qorumağı bacardı və 1979-cu ildə İngiltərədə liqa çempionluğu titulunu yenidən qazandı. Ümumilikdə Peyslinin klubda çalışdığı 9 il ərzində Liverpul 21 titul qazandı. Bunlara 3 dəfə UEFA Çempionlar Liqası kuboku, 1 dəfə UEFA Avropa Liqası, 6 dəfə ölkə çempionluğu və ardıcıl olaraq 3 dəfə İngiltərə Liqa Kuboku daxildir. Onun yeganə qazana bilmədiyi turnir isə İngiltərə Federasiya Kuboku olmuşdur." }
